fields.description:
Мы ищем Golang разработчика в высоконагруженный международный образовательный проект. Первостепенная задача - масштабирование существующей платформы под высокие нагрузки.
️Требования:
От 3-х лет бэкенд разработки
Опыт коммерческой разработки на Golang;
Опыт разработки высоконагруженных систем на микросервисной архитектуре;
NoSQL (MongoDB);
Kafka, RabbitMQ, etc.

Медицинская компания «ЛабСтори» создана в 2009 году. За это время мы открыли 13 центров в пяти городах России и вошли в тройку лидеров медицинской диагностики.
В связи с расширением и развитием нам требуется программист.
Обязанности:
- Анализ, модернизация и разработка имеющихся и новых программных продуктов;
- Работа с backend, с уклоном fullstack;
- Оптимизация программного кода.

В задачи входит:
Доработка системы электронного документооборота ТЕЗИС;
Разработка Java-приложений на платформе CUBA;
Разработка механизмов интеграции со сторонними информационными системами;
Разработка и настройка процессов на движке ТЕЗИС;
Техническая поддержка пользователей (3-я линия);
Участие в разработке алгоритмов и технических заданий.
